import React from "react";
import SingleInputContainer from './SingleInputContainer';
import Warning from "./warning";


function DisplayForm(props){
    const addDoctorInputValue=[
        {
          'name':'fName',
          'type':'text',
          'label':'First Name',
          'required':true,
          'validationType':"name",
        },{
          'name':'lName',
          'type':'text',
          'label':'Last Name',
          'required':true,
          'validationType':"name",
        },{
          'name':'cellPhone1',
          'type':'tel',
          'label':'Cell Phone 1',
          'required':true,
          'validationType':"phone",
        },{
          'name':'cellPhone2',
          'type':'tel',
          'label':'Cell Phone 2(optional)',
          'required':false,
          'validationType':"phone",
        },{
          'name':'city',
          'type':'text',
          'label':'City',
          'required':true,
          'validationType':"name",
        },{
          'name':'subcity',
          'type':'text',
          'label':'Sub City',
          'required':true,
          'validationType':"name",
        },{
          'name':'woreda',
          'type':'number',
          'label':'Woreda',
          'required':true,
          'validationType':"number",
        },{
          'name':'birthPlace',
          'type':'text',
          'label':'Birth Place',
          'required':true,
          'validationType':"name",
        },{
          'name':'dob',
          'type':'Date',
          'label':'Date Of Birth',
          'required':true,
          'validationType':"date",
        },{
          'name':'email',
          'type':'email',
          'label':'Email',
          'required':true,
          'validationType':"email",
        },{
          'name':'gender',
          'type':'select',
          'label':'Gender',
          'required':true,
          'validationType':"gender",
        },{
          'name':'universityName',
          'type':'text',
          'label':'University Name',
          'required':true,
          'validationType':"name",
        },{
          'name':'yearOfGraduaion',
          'type':'Date',
          'label':'Year Of Graduaion',
          'required':true,
          'validationType':"year",
        },{
          'name':'CGPA',
          'type':'number',
          'label':'CGPA',
          'required':true,
          'validationType':"grade",
        },{
          'name':'language',
          'type':'text',
          'label':'Language',
          'required':true,
          'validationType':"name",
        },{
          'name':'speciality',
          'type':'text',
          'label':'Speciality',
          'required':true,
          'validationType':"name",
        },{
          'name':'qualification',
          'type':'text',
          'label':'Qualification',
          'required':true,
          'validationType':"name",
        },
      ];
      const {intergratedValue,handler,handleSubmit} = Warning(addDoctorInputValue,props.pageTitle);
      const addDoctorInput=intergratedValue.map((value)=>{
        return(<SingleInputContainer name={value.name} type={value.type} handler={handler}
        label={value.label} error={value.error} required={value.required} validationType={value.validationType}/>);
      })
    return(
        <form  onSubmit={handleSubmit}>
          <div className='formInput'>
          <div className='personal_Information'> 
            <h3 className="title">Personal Information</h3>
            <div className='fullName'>
              {addDoctorInput[0]}{addDoctorInput[1]}
            </div>
            <div className='phoneNumber'>
              {addDoctorInput[2]}{addDoctorInput[3]}
            </div>
            <div className='address'>
              {addDoctorInput[4]}{addDoctorInput[5]}{addDoctorInput[6]}
            </div>
            <div className='birthInfo'>
              {addDoctorInput[7]}{addDoctorInput[8]}
            </div>
            <div style={{display:"flex"}}>
              {addDoctorInput[9]}{addDoctorInput[10]}
            </div>
          </div>
          <hr className='middleHr'/>
          <div>
            <div className='acadamy_information'>
              <h3 className="title">Acadamy Information</h3>
                <div style={{display:"flex"}}>{addDoctorInput[11]}{addDoctorInput[12]}</div>
                <div style={{display:"flex"}}>{addDoctorInput[13]}{addDoctorInput[14]}</div>
            </div>
            <hr className="middleHr"/>
            <div className="additional_information">
              <h3 className="title">Additional Information</h3>
              <div style={{display:"flex"}}>
                {addDoctorInput[15]}{addDoctorInput[16]}
              </div>
            </div>
          </div>
          </div>
         
          <button type="submit">Submit</button>
        </form> 
);
}
export default DisplayForm;
